% Cooling rate and mean charge from:
%   Determination of the tolerable impurity concentrations in a fusion reactor
%   using a consistent set of cooling factors,T. PÃ¼tterich et al 2019 Nucl. Fusion 59 056013
%   https://doi.org/10.1088/1741-4326/ab0384
%
function data = lz_zmean_Putterich_2019

dataz  = meanz;
datalz = lz;

if ~all(dataz.te == datalz.te)
   error('unconsistency in data');
end
noms_z  = fieldnames(dataz);
noms_lz = fieldnames(dataz);
if length(union(noms_z,noms_lz)) ~= length(noms_z)
   error('unconsistency in data');
end
    
for k=1:length(noms_z)
    switch noms_z{k}
        case 'te'
            data.te = reshape(dataz.te',[numel(dataz.te),1]);
        otherwise
            data.(noms_z{k}).Zave = reshape(dataz.(noms_z{k})',[numel(dataz.(noms_z{k})),1]);
            data.(noms_z{k}).Lz   = reshape(datalz.(noms_z{k})',[numel(datalz.(noms_z{k})),1]);
    end
end


